import {GooglePlace} from "./components/GooglePlace"



function App() {
  return (
    <div className="App">
      <h1 >
      API STUFF
      </h1>
        <GooglePlace />
        <DarkSky />
        <EventbriteInfo />
    </div>
  );
}

export default App;
